import React from 'react';
import {Route, Switch } from 'react-router-dom'
import Login from './components/Login'
import PrivateRoute from './components/PrivateRoute'
import './App.css';
import Signup from './components/Signup';
import DinerDash from './components/Diner/DinerDash'
import DinnerListProvider from './Contexts/DinerContext'
import DinerProvider from './Contexts/DinerContext'
import DinerTruckProvider from './Contexts/DinerContext'


function App() {
  return (
    <DinnerListProvider>
    <DinerTruckProvider>
    <DinerProvider>
    <div className="App">
    <Switch>
    <Route path='/' exact component ={Login}/>
    <Route path='/Signup' component={Signup}/>
    <PrivateRoute path='/Diner/DashBoard' component={DinerDash}/>
    </Switch>
    </div>
    </DinerProvider>
    </DinerTruckProvider>
    </DinnerListProvider>
  );
}

export default App;
